// SPDX-License-Identifier: MIT
pragma solidity >=0.4.22 <0.9.0;

contract AuthContract {
    struct User {
        string username;
        string email;
        string password;
        address metamaskAddress;
    }

    User[] private users;
    mapping(string => bool) private usernames;
    mapping(string => bool) private emails;

    function register(string memory _username, string memory _email, string memory _password) public {
        require(!usernames[_username], "Username already exists.");
        require(!emails[_email], "Email already exists.");
        require(bytes(_password).length > 8, "Password is too weak.");

        users.push(User(_username, _email, _password, address(0)));
        usernames[_username] = true;
        emails[_email] = true;
    }

    function login(string memory _email, string memory _password) public view returns (bool) {
        require(emails[_email], "Email not found.");
        require(keccak256(bytes(users[getEmailIndex(_email)].password)) == keccak256(bytes(_password)), "Invalid password.");

        return true;
    }

    function isMetamaskAddressTaken(address _metamaskAddress) public view returns (bool) {
        for (uint i = 0; i < users.length; i++) {
            if (users[i].metamaskAddress == _metamaskAddress) {
                return true;
            }
        }
        return false;
    }

    function getEmailIndex(string memory _email) private view returns (uint) {
        for (uint i = 0; i < users.length; i++) {
            if (keccak256(bytes(users[i].email)) == keccak256(bytes(_email))) {
                return i;
            }
        }
        revert("Email not found.");
    }

    function setUserMetamaskAddress(address _metamaskAddress) public {
        uint userIndex = getEmailIndex(getUserEmail(msg.sender));
        require(users[userIndex].metamaskAddress == address(0), "Metamask address already set.");
        users[userIndex].metamaskAddress = _metamaskAddress;
    }

    function getUserEmail(address _userAddress) public view returns (string memory) {
        for (uint i = 0; i < users.length; i++) {
            if (users[i].metamaskAddress == _userAddress) {
                return users[i].email;
            }
        }
        revert("User not found.");
    }
}
